export abstract class BaseLogger {
    abstract Log(message: string): void;
}

export class Logger extends BaseLogger {
    Log(message: string) {
        console.log(message);
    }
}

export class LoggerEmail {
    Log(message: string) {
        console.log("Log to console" + message);
        console.log("Send email" + message);

    }
}
